# thonk generation
factors = {}

for i in range(256):
  for f in range(16,1,-1):
    if i % f == 0:
      if i//f < 20:
        factors[i] = (f, i//f)
        break

def genpayload(num, steps, l):
  if l:
    c1, c2 = "<",">"
  else:
    c1, c2 = ">","<"
  if num in list(range(0,12)):
    return "-" * num
  elif num in list(range(244,256)):
    return "+" * (256-num)
  else:
    bleh = ""
    while num not in factors.keys():
      bleh += "-"
      num -= 1
    bleh += c1 * steps
    f1, f2 = factors[num]
    bleh += "+" * f1
    bleh += "[-" + c2 * steps 
    bleh += "-" * f2 
    bleh += c1 * steps + "]"
    bleh += c2 * (steps)
    #print(bleh)
    return bleh

def gen(flag):
  steps = 1
  og = flag[:]
  out = "[[->>]]<<[[-<]]+++++++[[---->>]]<<[[<---]]" # Initial
  out += ">" * (len(flag) + 1) + "[-]<" # takes us to last thing
  flag = [flag[x]-8 if x % 2 else flag[x]- 5 for x in range(len(flag))]
  while len(flag) != 1:
    out += genpayload(flag[-1], steps, 0)
    out += "<" * (len(flag) - 1)
    out += genpayload(flag[0], steps, 1)
    out += ">" * (len(flag) - 2)
    flag = flag[1:-1]
    print(flag)
    steps += 1
  out += genpayload(flag[0], steps, 1)
  out += (1+len(og)//2) * "<"
  #out += "\n<[>>[<<[-]]]"
  for i in range(2, len(og)+2):
    print(f">[{'<'*i}[-]{'>'*i}[-]]")
    out += f">[{'<'*i}[-]{'>'*i}[-]]"
  out += "<" * len(og)
  print(out)


